import './App.css';
import {useEffect} from 'react';
import requests from './requests';
import instance from './axios';
function State() {
  const starter = useEffect(()=>{
    request();
  },[]);
  const request = async () =>{
    const reponse= await fetch(`https://api.themoviedb.org/3/trending/all/week?api_key=c95b5c7250079e204e0356858ae6f7d5&language=en-US`);
    const data=reponse.json();
    console.log(data);
  }
  return(
  <div></div>
  );
}

function App() {
  return (
    <div className="App">
      <h1>Hello React</h1>
      <State/>
      {<Row title="Trending" fetchrequest={requests.fetchTrending} />}

    </div>
  );
}

export default App;
